function Education () {
    return (
        <>
            <div id="education" class="education">
                <h1>Education</h1>
                <h2>Toronto Metropolitan University</h2>
                <h3>Computer Science- BSc.(Hons)</h3>
                <h4>Sept 2022 - Present</h4>
            </div>
        </>
    );
}

export default Education;
